var matchPlayersAndTrainers = function (players, trainers) {
    players.sort((a, b) => a - b);
    trainers.sort((a, b) => a - b);

    let p = 0;
    let t = 0;
    while (p < sortedPlayers.length && t < sortedTrainers.length) {
        if (sortedPlayers[p] <= sortedTrainers[t]) {
            p++;
        }
        t++;
    }
    return p;
};

